import "./Card.css";
import React from "react";
import bitcoin from "./bitcoin.png"

const Card = () =>{

    return(
        <div className="card-container">
            <div className="card-holder">
                <div className="card-image child">
                    <img src={bitcoin}/>
                </div>
                <div className="card-details child">
                    <ul>
                        <p>Name</p>
                        <p>Price</p>
                        <p>Current</p>
                        {/* <li>Name</li>
                        <li>Price</li>
                        <li>Current</li> */}
                    </ul>
                </div>
            </div>          
        </div>
    )
}

export default Card;
